import './Button.scss'
import { withRouter } from 'react-router-dom';




import { useState } from 'react';

const App = () => {
  const [modalOpen, setModalOpen] = useState(false);

  return (
    <div>
      <button onClick={() => setModalOpen(true)}>
        Exibir modal
      </button>
      <button onClick={() => setModalOpen(false)}>
        Remover modal
      </button>

      { modalOpen && <Modal /> }
    </div>
  );
}

export default Button
